import React from 'react';
// import { Link } from 'react-router-dom';
import { Link } from 'react-scroll';
import '../styles.css';

const Navigation = () => {
  return (
    <nav className="nav-container">
      <div className="nav-left">
        <Link to="/" smooth={true} duration={500} className="nav-link">{"<home/ >"}</Link>
        <Link to="experience" smooth={true} duration={500} className="nav-link">{"<experience/ >"}</Link>
        <Link to="contact" smooth={true} duration={500} className="nav-link">{"<contact/ >"}</Link>
      </div>
      <div className="nav-right">
        <a href="https://github.com/tammytran96" className="nav-link" target="_blank">GitHub</a>
        <a href="https://www.linkedin.com/in/tammy-t-tran/" className="nav-link" target="_blank">LinkedIn</a>
      </div>
    </nav>
  );
};

export default Navigation;
